// Auto-prefix Westfield API calls
$.ajaxPrefilter( function( options, originalOptions, jqXHR ) {
    options.crossDomain = true;
    if (options.url.indexOf('http') == -1) {
        options.url = 'http://api.westfield.io/api' + options.url;
    }
});

